local legitTab = Window:CreateTab("legit", 4483362458) -- Title, Image
local legitSection = legitTab:CreateSection("legit")
local Button = legitTab:CreateButton({
   Name = "aimbot",
   Callback = function()
local Camera = workspace.CurrentCamera
local Players = game:GetService("Players")
local RunService = game:GetService("RunService")
local UserInputService = game:GetService("UserInputService")
local TweenService = game:GetService("TweenService")
local LocalPlayer = Players.LocalPlayer
local Holding = false

_G.AimbotEnabled = true
_G.TeamCheck = true
_G.AimPart = "Head"
_G.Sensitivity = 0

_G.CircleSides = 64
_G.CircleColor = Color3.fromRGB(255, 255, 255)
_G.CircleTransparency = 0.7
_G.CircleRadius = 80
_G.CircleFilled = false
_G.CircleVisible = true
_G.CircleThickness = 0

local FOVCircle = Drawing.new("Circle")
FOVCircle.Position = Vector2.new(Camera.ViewportSize.X / 2, Camera.ViewportSize.Y / 2)
FOVCircle.Radius = _G.CircleRadius
FOVCircle.Filled = _G.CircleFilled
FOVCircle.Color = _G.CircleColor
FOVCircle.Visible = _G.CircleVisible
FOVCircle.Radius = _G.CircleRadius
FOVCircle.Transparency = _G.CircleTransparency
FOVCircle.NumSides = _G.CircleSides
FOVCircle.Thickness = _G.CircleThickness

local function GetClosestPlayer()
    local MaximumDistance = _G.CircleRadius
    local Target = nil

    for _, v in next, Players:GetPlayers() do
        if v.Name ~= LocalPlayer.Name then
            if _G.TeamCheck == true then
                if v.Team ~= LocalPlayer.Team then
                    if v.Character ~= nil then
                        if v.Character:FindFirstChild("HumanoidRootPart") ~= nil then
                            if v.Character:FindFirstChild("Humanoid") ~= nil and v.Character:FindFirstChild("Humanoid").Health ~= 0 then
                                local ScreenPoint = Camera:WorldToScreenPoint(v.Character:WaitForChild("HumanoidRootPart", math.huge).Position)
                                local VectorDistance = (Vector2.new(UserInputService:GetMouseLocation().X, UserInputService:GetMouseLocation().Y) - Vector2.new(ScreenPoint.X, ScreenPoint.Y)).Magnitude

                                if VectorDistance < MaximumDistance then
                                    Target = v
                                end
                            end
                        end
                    end
                end
            else
                if v.Character ~= nil then
                    if v.Character:FindFirstChild("HumanoidRootPart") ~= nil then
                        if v.Character:FindFirstChild("Humanoid") ~= nil and v.Character:FindFirstChild("Humanoid").Health ~= 0 then
                            local ScreenPoint = Camera:WorldToScreenPoint(v.Character:WaitForChild("HumanoidRootPart", math.huge).Position)
                            local VectorDistance = (Vector2.new(UserInputService:GetMouseLocation().X, UserInputService:GetMouseLocation().Y) - Vector2.new(ScreenPoint.X, ScreenPoint.Y)).Magnitude

                            if VectorDistance < MaximumDistance then
                                Target = v
                            end
                        end
                    end
                end
            end
        end
    end

    return Target
end

UserInputService.InputBegan:Connect(function(Input)
    if Input.UserInputType == Enum.UserInputType.MouseButton2 then
        Holding = true
    end
end)

UserInputService.InputEnded:Connect(function(Input)
    if Input.UserInputType == Enum.UserInputType.MouseButton2 then
        Holding = false
    end
end)

RunService.RenderStepped:Connect(function()
    FOVCircle.Position = Vector2.new(UserInputService:GetMouseLocation().X, UserInputService:GetMouseLocation().Y)
    FOVCircle.Radius = _G.CircleRadius
    FOVCircle.Filled = _G.CircleFilled
    FOVCircle.Color = _G.CircleColor
    FOVCircle.Visible = _G.CircleVisible
    FOVCircle.Radius = _G.CircleRadius
    FOVCircle.Transparency = _G.CircleTransparency
    FOVCircle.NumSides = _G.CircleSides
    FOVCircle.Thickness = _G.CircleThickness

    if Holding == true and _G.AimbotEnabled == true then
        TweenService:Create(Camera, TweenInfo.new(_G.Sensitivity, Enum.EasingStyle.Sine, Enum.EasingDirection.Out), {CFrame = CFrame.new(Camera.CFrame.Position, GetClosestPlayer().Character[_G.AimPart].Position)}):Play()
    end
end)
   end,
})
local Button = legitTab:CreateButton({
   Name = "inf ammo",
   Callback = function()
  -- Function to set ammo counts to 999
local function setAmmoCounts()
    local player = game:GetService("Players").LocalPlayer
    local playerGui = player.PlayerGui

    if playerGui and playerGui.GUI and playerGui.GUI.Client and playerGui.GUI.Client.Variables then
        playerGui.GUI.Client.Variables.ammocount.Value = 999
        playerGui.GUI.Client.Variables.ammocount2.Value = 999
    end
end

-- Function to continuously check and set ammo counts
local function checkAndSetAmmoCounts()
    while true do
        setAmmoCounts(999)
        wait(1)  -- Adjust the interval as needed, e.g., every second
    end
end

-- Call the function initially
setAmmoCounts(999)

-- Run the checking function in a coroutine to keep it running
coroutine.wrap(checkAndSetAmmoCounts)(999)
   end,
})
local Button = legitTab:CreateButton({
   Name = "inf jump",
   Callback = function()
   -- Function to enable infinite jump
local function enableInfiniteJump()
    local player = game.Players.LocalPlayer
    local character = player.Character
    local humanoid = character and character:FindFirstChildOfClass("Humanoid")
    
    -- Check if player and necessary parts exist
    if player and character and humanoid then
        local function onKeyPress(input)
            if input.KeyCode == Enum.KeyCode.Space then
                humanoid:ChangeState(Enum.HumanoidStateType.Jumping)
            end
        end
        
        game:GetService("UserInputService").InputBegan:Connect(onKeyPress)
    else
        warn("Player, character, or humanoid not found.")
    end
end


-- Call the function to enable infinite jump
enableInfiniteJump()
   end,
})
local Button = legitTab:CreateButton({
   Name = "esp",
   Callback = function()
-- Function to add chams to a player's character
local function addChams(player)
    if player.Character then
        for _, part in pairs(player.Character:GetChildren()) do
            if part:IsA("BasePart") then
                -- Create a BoxHandleAdornment for each part
                local adornment = Instance.new("BoxHandleAdornment")
                adornment.Adornee = part
                adornment.Size = part.Size
                adornment.Transparency = 0.7  -- Semi-transparent
                adornment.Color3 = Color3.fromRGB(0, 255, 0)  -- Green color
                adornment.AlwaysOnTop = true
                adornment.ZIndex = 10  -- Render on top
                adornment.Parent = part
            end
        end
    end
end

-- Add chams to all current players except the local player
for _, player in pairs(game.Players:GetPlayers()) do
    if player ~= game.Players.LocalPlayer then
        addChams(player)
    end
end

-- Add chams to any new players who join except the local player
game.Players.PlayerAdded:Connect(function(player)
    player.CharacterAdded:Connect(function(character)
        if player ~= game.Players.LocalPlayer then
            addChams(player)
        end
    end)
end)

-- Reapply chams when local player respawns
game.Players.LocalPlayer.CharacterAdded:Connect(function(character)
    -- Wait for the character to fully load
    wait(1)
    for _, player in pairs(game.Players:GetPlayers()) do
        if player ~= game.Players.LocalPlayer then
            addChams(player)
        end
    end
end)

   end,
})
